We present @shopandsk8 hosted at our HQ location in Huntington Beach CA on August 29th from 10AM- 4PM! 

Shop & Skate was started & operated by @xelamashup The concept is an independent business expo of skater operated businesses all showcasing their creations for sale in the same place, & this time it’s at our place! 

So come on by & support the diverse & growing roller skate industry! 

You will be able to shop from local artists, Moxi staff and Moxi’s marked down apparel, blemished skates (limited to 2 per household ) and more!

