Important Information for those planning on attending! Masks are mandatory no matter if you are vaccinated or not! If you do not wear a mask you will not be allowed to enter. 

Please keep a 6ft distance from others that are not in your household. 

In the area there will only be 35 people allowed to shop at a time. You may be waiting to be let in.

There are NO public restrooms. 

Address: 5482 Business Dr

If you have any questions you can message @shopandsk8 or email us at cs@moxirollerskates.com

